import React, { useState, useEffect } from 'react';
import { Modal } from '@consta/uikit/Modal';
import { TextField } from '@consta/uikit/TextField';
import { Button } from '@consta/uikit/Button';
import { Grid, GridItem } from '@consta/uikit/Grid';
import './EditCustomerModal.css';

interface Customer {
  id: number;
  customerCode: string;
  customerName: string;
  customerInn: string;
  customerKpp: string;
  customerLegalAddress: string;
  customerPostalAddress: string;
  customerEmail: string;
  customerCodeMain: string | null;
  isOrganization: boolean;
  isPerson: boolean;
}

type Props = {
  isOpen: boolean;
  onClose: () => void;
  handleSaveCustomer: (customer: Customer) => void;
  currentCustomer: Customer | null;
};

const EditCustomerModal: React.FC<Props> = ({
  isOpen,
  onClose,
  handleSaveCustomer,
  currentCustomer,
}) => {
  const [updatedCustomer, setUpdatedCustomer] = useState<Customer | null>(
    currentCustomer
  );

  useEffect(() => {
    setUpdatedCustomer(currentCustomer);
  }, [currentCustomer]);

  const handleInputChange =
    (field: keyof Customer) => (value: string | null) => {
      setUpdatedCustomer((prev) =>
        prev
          ? {
              ...prev,
              [field]: value === '' ? null : value,
            }
          : null
      );
    };

  const handleSubmit = () => {
    if (updatedCustomer) {
      handleSaveCustomer(updatedCustomer);
    }
  };

  return (
    <Modal
      isOpen={isOpen}
      onClose={onClose}
      style={{ maxWidth: '800px', position: 'relative' }}
    >
      <div className="modalContainer">
        <h3>Обновление заказчика</h3>
        {updatedCustomer && (
          <Grid cols={3} gap="m" className="gridContainer">
            <GridItem>
              <TextField
                label="Наименование"
                value={updatedCustomer.customerName || ''}
                onChange={(value) => handleInputChange('customerName')(value)}
                placeholder="Введите наименование"
              />
            </GridItem>
            <GridItem>
              <TextField
                label="ИНН"
                value={updatedCustomer.customerInn || ''}
                onChange={(value) => handleInputChange('customerInn')(value)}
                placeholder="Введите ИНН"
              />
            </GridItem>
            <GridItem>
              <TextField
                label="КПП"
                value={updatedCustomer.customerKpp || ''}
                onChange={(value) => handleInputChange('customerKpp')(value)}
                placeholder="Введите КПП"
              />
            </GridItem>
            <GridItem>
              <TextField
                label="Юридический адрес"
                value={updatedCustomer.customerLegalAddress || ''}
                onChange={(value) =>
                  handleInputChange('customerLegalAddress')(value)
                }
                placeholder="Введите юридический адрес"
              />
            </GridItem>
            <GridItem>
              <TextField
                label="Почтовый адрес"
                value={updatedCustomer.customerPostalAddress || ''}
                onChange={(value) =>
                  handleInputChange('customerPostalAddress')(value)
                }
                placeholder="Введите почтовый адрес"
              />
            </GridItem>
            <GridItem>
              <TextField
                label="Электронная почта"
                value={updatedCustomer.customerEmail || ''}
                onChange={(value) => handleInputChange('customerEmail')(value)}
                placeholder="Введите электронную почту"
              />
            </GridItem>
            <GridItem>
              <TextField
                label="Вышестоящий контрагент"
                value={updatedCustomer.customerCodeMain || ''}
                onChange={(value) =>
                  handleInputChange('customerCodeMain')(value)
                }
                placeholder="Введите код вышестоящего контрагента"
              />
            </GridItem>
          </Grid>
        )}
      </div>
      <div className="buttonContainer">
        <Button label="Обновить" onClick={handleSubmit} />
        <Button label="Отмена" onClick={onClose} />
      </div>
    </Modal>
  );
};

export default EditCustomerModal;
